import React from "react";
import { ProcessedComment } from "App";

interface Option {
    value: string;
    name: string;
}
const sortOptionList: Option[] = [
    { value: "latest", name: "latest" },
    { value: "oldest", name: "oldest" },
];

const ControlMenu: React.FC<{ val }> = ({ diaryList }) => {
    return (
        <select>
            {diaryList.map((item) => (
                <option key={item.id}>{item.date}</option>
            ))}
        </select>
    );
};
const DiaryList: React.FC<{ diaryList: ProcessedComment[] }> = (diaryList) => {
    return (
        <div>
            <ControlMenu diaryList={diaryList.diaryList} />
            {diaryList.diaryList.map((item) => (
                <div key={item.id}>
                    {item.content}
                    {/* <div>{item.date}</div>
                    <div>{item.content}</div> */}
                </div>
            ))}
        </div>
    );
};

DiaryList.defaultProps = {
    diaryList: [],
};

export default DiaryList;
